import React from 'react'

import {
    FormControl,
    FormLabel,
    FormHelperText,
    Input,
    Center
} from '@chakra-ui/react'  

const AddRecipe = () => {
  return (
    <>
        <FormControl>
            <FormLabel style = {{textAlign: 'center', fontSize: 'max(1.5vw, 15px0'}}>Name</FormLabel>
            <Input type='email' />
            <FormHelperText>We'll never share your email.</FormHelperText>
        </FormControl>    
    </>
    )
}

export default AddRecipe
